import React from 'react';
import ReactDOM from 'react-dom';
import './style.css'

let image = <img src="img/logo192.png"/>

async function fetchAllUsers(){
  const res = await axios.get('http:localhost/users');
  console.log(res);
}

React.useEffect(
fetchAllUsers,
  [])


ReactDOM.render(
  <div>
    <h1>Hello React !</h1>
    {image}
    <p>{}</p>
  </div>,
  document.getElementById('root')
)
